import axios from 'axios'
import React,{useEffect} from 'react'

function Profile({posts,setPosts}) {

    useEffect(() => {
        const JWTtoken = localStorage.getItem("JWTtoken")
        axios.get("http://localhost:3001/posts/myposts",{
            headers:{
                'auth-token':JWTtoken
            }
        })
        .then(res=>{
            console.log(res)
            setPosts(res.data)
        })
    }, [])

    return (
        <div>
            
        </div>
    )
}

export default Profile
